import NavigationBar from './Navigationbar';
import { Jumbotron as Jumbo, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
 
const Jumbotron = () => {

    return (
        <Jumbo className = "jumbotron">
            <div className="offset"></div>
            <NavigationBar />
            <Container className = "m-5 text-light">
                <h2>Got a sick pet? He'll love us, I promise.</h2>
                <p>
                    We care about your pet's happiness because they matter too. Let your pet experience the joy of being a petient of Molly's Vet.
                </p>
                <div className="text-center m-5">
                    <Link to="/contact" className = "btn btn-warning">Contact Us</Link>
                </div>
            </Container>
        </Jumbo>
    )

}

export default Jumbotron
